const ControlMenu = () => {
  return <select></select>;
};

const DiaryList = ({ diaryList }) => {
  return (
    <div>
      <ControlMenu />
      {diaryList.map((it) => (
        <div key={it.id}>{it.contnet} </div>
      ))}
    </div>
  );
};

DiaryList.defaultProps = {
  diaryList: [],
};

export default DiaryList;
